  01> OVERBYE, Richard James
  b 11.11.1991
  Richard b. at Joondalup. He attends Emmanuel Christian Community School, Girrawheen, Western
  Australia.
  > OVERBYE, Andrew Michael
  b 20.06.1994
  Andrew b. at Joondalup. He is in kindergarten at Mirrabooka, Western Australia.
  02> OVERBYE, Alison Frances m on 28.01.1989 to GARRETT, William Edward
  John
  b 09.09.1964
  b 25.03.1963
  Alison b. at Gisborne and m. at Waerenga-a-hika, Gisborne. William, s/o Clive Joseph Garrett and
  Wendy Hartwell, b. at Leamington Spa, England. Address: Chandos House, Shronedarragh, Headford,
  Killarney, County Kerry, Eire.
  Alison was educated at Makauri Primary School, Gisborne Intermediate School and Lytton High School
  where she won the Archer Cup for Art (1980), best performance in School Certificate (1980), highest
  aggregate in Form 6 (1981) and Dux (1982). She graduated from Canterbury University School of Fine
  Arts with a BFA in 1990. In 1994 she and William immigrated to Ireland, She is currently working
  as a mother, dressmaker/designer and artist.
  William runs a business called Consultant Solutions (CONSOL) in Ireland and works as a systems
  consultant within Ireland and Europe. He has a keen interest in mountaineering and rock-climbing.
  01> GARRETT, Rachael Erin
  b 04.11.1992
  Rachael b. at Christchurch. She is currently attending Barraduff Primary School, near
  Killarney, Eire.
  02> GARRETT, James William
  b 20.08.1995
  James b. at Tralee, Eire.
