  Joyce Mill, b. at Gisborne. Address: 17 Taruheru Crescent, Gisborne.
  Hugh was educated at Makauri School, Gisborne Intermediate and Lytton High School then graduated
  BE(Hons) in Mechanical Engineering from the University of Canterbury in 1990. He is now working
  for a roofing contractor.
